__NUXT_JSONP__("/drugs/Tipapkinogene_Sovacivec", (function(a,b,c,d){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"1052105-48-2",chebiId:b,chemicalFormula:b,definition:"A cancer vaccine comprised of a modified, replication-defective, vaccinia virus Ankara (MVA) strain encoding the tumor-associated antigens (TAAs) human papillomavirus type 16 (HPV16) subtypes E6 and E7, and human interleukin-2 (IL-2), with potential immunostimulating and antineoplastic activities. Vaccination with tipapkinogene sovacivec stimulates the host immune system to mount a cytotoxic T-lymphocyte (CTL) response against tumor cells expressing HPV16 E6 and E7, resulting in tumor cell lysis. Expression of IL-2 augments the specific CTL response against HPV16 E6- and E7-expressing tumor cells.",fdaUniiCode:"P34L5Y2SR5",identifier:"C88326",preferredName:c,semanticType:"Immunologic Factor",subclassOf:["C2313"],synonyms:["HPV16 E6\u002FE7-encoding MVA Vaccine TG4001","MVA-HPV-IL2","MVA-HPV16E6\u002FE7-IL2","R3484","RG3484","RO5217790","TG 4001","TG-4001","TG4001","TIPAPKINOGENE SOVACIVEC",c]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FTipapkinogene_Sovacivec",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("Tipapkinogene_Sovacivec","","Tipapkinogene Sovacivec","2021-10-30T13:46:55.693Z")));